import './App.css';
import Navbar from './Components/Navbar.js';
import Addnote from'./Components/Addnote.js';
import About from './Components/About.js';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NoteState from './context/NoteState.js';
import LoginSignup from './Components/LoginSignup.jsx';
import Notes from './Components/Notes.js';
import Alert from './Components/Alert.js';
import { useState } from 'react';
function App() {
const [isdelete,setdelete]=useState("danger");

const [isconfirm,setconfirm]=useState(true);




  return (

  <>

  <NoteState>

  <Router>


<Navbar />

<Alert alert={isdelete} updatedelete={setdelete} cancel={isconfirm} confirm={setconfirm}/>




<Routes>

  <Route exact path='/' element={<Addnote />} />

  <Route exact path='/notes/*' element={<Notes />}/>

  <Route exact path="/createnote" element={<Addnote />}/>

 <Route exact path='/about' element={<About></About>} /> 

 <Route exact path='/signup' element={<LoginSignup setIsLogin={false} />} />

 <Route exact path='/login' element={<LoginSignup setIsLogin={true} />}/>

</Routes>
  </Router>
  </NoteState>
  </>
  );
}

export default App;
